Dragon was in the lead for the start of round 2. Unfortunately, the better wrestler of the team that is behind starts out for round 2 and the lesser wrestler for the team that is ahead starts out for round 2. Isamar quickly gets control of Daisy. Luckily for team Dragon, the mat circle on the temporary set is significantly smaller and Cheyenne is easily able to tag in when her partner is in trouble. The tags don't do much good for Team Dragon. Bella and Isamar are ON today. They put cheyenne and Daisy in trouble and get the score back up into their favor.

